>FABRICANT ET DISTRIBUTEUR DE MATERIEL POUR LES SYSTEMES PHOTOVOLTAIQUES</span></span></p>\n<p class="titre-bleu" style="text-align: center;"><span style="font-family: comic sans ms,sans-serif;"><span style="color: #0000ff;"><br /></span></span></p>\n<span style="font-family: comic sans ms,sans-serif;">\n<p style="text-align: center;"><img src="http://kogys-emailing.by.catalyz.fr/uploads/repository/systovi/logo_systovia.gif" width="268" height="72" /></p>\n</span>\n<p>&nbsp;</p>\n<p><span style="font-family: comic sans ms,sans-serif;"><span style="font-size: x-small;">Bonjour,</span></span></p>\n<p><span style="font-family: comic sans ms,sans-serif;"><span style="font-size: x-small;">Kogys,  distributeur sp&eacute;cialis&eacute; dans le mat&eacute;riel photovolta&iuml;que, vous pr&eacute;sente  un nouveau kit complet de 3 KWc destin&eacute; aux particuliers&nbsp;: une v&eacute;ritable  solution d&rsquo;int&eacute;gration innovante et fiable <span style="font-size: small;"><span style="text-decoration: underline;"><strong>r&eacute;pondant aux nouveaux crit&egrave;res d''int&eacute;gration renforc&eacute;e.</strong></span></span><br /></span></span></p>\n<p><span style="font-family: comic sans ms,sans-serif;"><span style="font-size: x-small;">Le syst&egrave;me brevet&eacute;&laquo;&nbsp;SYSTO&eacute;tanche&nbsp;&raquo; qui se distingue  par des concepts innovants dont la finalit&eacute; est bien entendu la production d&rsquo;&eacute;lectricit&eacute; mais &eacute;galement d&rsquo;&ecirc;tre des &eacute;l&eacute;ments de  construction &agrave; part enti&egrave;re naturellement int&eacute;gr&eacute;s au b&acirc;timent (couverture, &eacute;tanch&eacute;it&eacute;, r&eacute;cup&eacute;ration de chaleur.&nbsp; Le syst&egrave;me SYSTOVI pr&eacute;sente une adaptabilit&eacute; sur tous types de charpentes (bois et acier), de formes de toitures (disposition et abergements sp&eacute;cifiques) et permet d&rsquo;assurer une ventilation efficace des modules.<br /></span></span></p>\n<p><span style="font-family: comic sans ms,sans-serif;"><span style="font-size: x-small;">SYSTOVI  s&eacute;lectionne avec le plus grand soin chaque composant pour ses qualit&eacute;s  techniques et durables parmi des fabricants europ&eacute;ens. Les produits  ayant &eacute;t&eacute; test&eacute;s dans la soufflerie du CSTB dans des conditions  climatiques extr&ecirc;mes, les clients peuvent envisager l&rsquo;installation des  panneaux photovolta&iuml;ques en toute s&eacute;r&eacute;nit&eacute;.</span></span></p>\n<p><span style="font-family: comic sans ms,sans-serif;"><span style="font-size: x-small;">Innovation, qualit&eacute;, comp&eacute;titivit&eacute; et proximit&eacute; de service sont les mots clefs de ce nouveau syst&egrave;me.</span></span></p>\n<p><span style="font-family: comic sans ms,sans-serif;"><span style="font-size: x-small;">Les points forts&nbsp;:</span></span></p>\n<p style="margin-left: 36pt; text-indent: -18pt;"><span style="font-family: comic sans ms,sans-serif;"><span style="font-size: x-small;">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Tr&egrave;s haut rendement&nbsp;: cellules allemandes monocristalines BOSCH, rendement sup&eacute;rieur &agrave; 17,3%</span></span></p>\n<p style="margin-left: 36pt; text-indent: -18pt;"><span style="font-family: comic sans ms,sans-serif;"><span style="font-size: x-small;">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Garantie produitdes modules photovolta&iuml;ques : 10 ans</span></span></p>\n<p style="margin-left: 36pt; text-indent: -18pt;"><span style="font-family: comic sans ms,sans-serif;"><span style="font-size: x-small;">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Garantie d&eacute;c&eacute;nale du fabricant du SYSTO&eacute;tanche</span></span></p>\n<p style="margin-left: 36pt; text-indent: -18pt;"><span style="font-family: comic sans ms,sans-serif;"><span style="font-size: x-small;">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Syst&egrave;me b&eacute;n&eacute;ficiant d''un Pass''Innovation CSTB<br /></span></span></p>\n<p style="margin-left: 36pt; text-indent: -18pt;"><span style="font-family: comic sans ms,sans-serif;"><span style="font-size: x-small;">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;  Production maximum gr&acirc;ce &agrave; une ventilation forc&eacute;e par &laquo;&nbsp;effet  chemin&eacute;e&nbsp;&raquo; (brevet SYSTOVI)<br />&nbsp;&nbsp; et par la performance &agrave; faible luminosit&eacute;</span></span></p>\n<p style="margin-left: 36pt; text-indent: -18pt;"><span style="font-family: comic sans ms,sans-serif;"><span style="font-size: x-small;">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Haute densit&eacute; de puissance&nbsp;: syst&egrave;me HD</span></span></p>\n<p style="margin-left: 36pt; text-indent: -18pt;"><span style="font-family: comic sans ms,sans-serif;"><span style="font-size: x-small;">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 100% int&eacute;gr&eacute; permettant l&rsquo;obtention du meilleur tarif de rachat</span></span></p>\n<p style="margin-left: 36pt; text-indent: -18pt;"><span style="font-family: comic sans ms,sans-serif;"><span style="font-size: x-small;">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Facile et rapide &agrave; poser</span></span></p>\n<p style="margin-left: 36pt; text-indent: -18pt;"><span style="font-family: comic sans ms,sans-serif;"><span style="font-size: x-small;">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Esth&eacute;tique&nbsp;: anodisation noire en standard</span></span></p>\n<p style="margin-left: 36pt; text-indent: -18pt;"><span style="font-family: comic sans ms,sans-serif;"><span style="font-size: x-small;">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Disponible en kits complets de 3000 Wc</span></span></p>\n<p style="margin-left: 36pt; text-indent: -18pt;"><span style="font-family: comic sans ms,sans-serif;"><span style="font-size: x-small;"><br /></span></span></p>\n<p><span style="font-family: comic sans ms,sans-serif;"><span style="font-size: x-small;">N''h&eacute;sitez pas &agrave; demander plus de renseignements en &eacute;crivant &agrave; <a href="mailto:contact@kogys.com">contact@kogys.com</a></span></span></p>\n<p><span style="font-family: comic sans ms,sans-serif;"><span style="font-size: x-small;">Vous pouvez &eacute;galement consulter les fiches techniques directement sur notre site <span class="MsoHyperlink"><a href="http://kogys-emailing.by.catalyz.fr//campaign/link/key/#EMAIL#-28">http://www.kogys.com/fr/produits</a></span></span></span></p>\n<table style="height: 1970px;" border="0" cellspacing="2" cellpadding="0" width="752">\n<tbody>\n<tr>\n<td style="height: 50px;" colspan="7">\n<h1 style="text-align: center;"><span style="font-family: comic sans ms,sans-serif;"><span style="font-size: medium;"><span style="font-size: small;"><span style="color: #3366ff;">Modules SYSTO&eacute;tanche HD-XL</span></span> <br /></span></span></h1>\n</td>\n</tr>\n<tr>\n<td style="height: 10px;" colspan="7">\n<h2 style="text-align: center;"><span style="font-size: small;"><span style="color: #3366ff;"><span style="font-family: comic sans ms,sans-serif;">Caract&eacute;ristiques m&eacute;caniques</span></span></span></h2>\n</td>\n</tr>\n<tr bgcolor="#cce3f3">\n<td style="height: 25px; text-align: left; width: 25px;" colspan="5"><span style="font-size: xx-small;"><span style="font-family: comic sans ms,sans-serif;">Cellules</span></span></td>\n<td style="text-align: left;" colspan="2"><span style="font-size: xx-small;"><span style="font-family: comic sans ms,sans-serif;">monocristalline &agrave; 3 bus, 6" (156mm x 156 mm)</span></span></td>\n</tr>\n<tr bgcolor="#cce3f3">\n<td style="height: 25px; text-align: left;" colspan="5"><span style="font-size: xx-small;"><span style="font-family: comic sans ms,sans-serif;">Module</span></span></td>\n<td style="text-align: left;" colspan="2"><span style="font-size: xx-small;"><span style="font-family: comic sans ms,sans-serif;">60 cellules par module, fond blanc</span></span></td>\n</tr>\n<tr bgcolor="#cce3f3">\n<td style="height: 25px; text-align: left;" colspan="5"><span style="font-size: xx-small;"><span style="font-family: comic sans ms,sans-serif;">Verre</span></span></td>\n<td style="text-align: left;" colspan="2"><span style="font-size: xx-small;"><span style="font-family: comic sans ms,sans-serif;">tremp&eacute;, haute transparence, trait&eacute; anti-jaunissement<br /></span></span></td>\n</tr>\n<tr bgcolor="#cce3f3">\n<td style="height: 25px; text-align: left;" colspan="5"><span style="font-size: xx-small;"><span style="font-family: comic sans ms,sans-serif;">Cadre<br /></span></span></td>\n<td style="text-align: left;" colspan="2"><span style="font-size: xx-small;"><span style="font-family: comic sans ms,sans-serif;">cadre anodis&eacute; noir, sp&eacute;cialement con&ccedil;u et brevet&eacute; par SYSTOVI, int&eacute;grant les fonctions d''&eacute;tanch&eacute;it&eacute; pour la couverture<br /></span></span></td>\n</tr>\n<tr bgcolor="#cce3f3">\n<td style="height: 25px; text-align: left;" colspan="5"><span style="font-size: xx-small;"><span style="font-family: comic sans ms,sans-serif;">Boitier de connexions et c&acirc;bles<br /></span></span></td>\n<td style="text-align: left;" colspan="2"><span style="font-size: xx-small;"><span style="font-family: comic sans ms,sans-serif;">IP65 avec diodes bypass, c&acirc;bles solaires 4 mm&sup2; double isolation &eacute;quip&eacute;s MC4 (long : 1,20 m)<br /></span></span></td>\n</tr>\n<tr bgcolor="#cce3f3">\n<td style="height: 25px; text-align: left;" colspan="5"><span style="font-size: xx-small;"><span style="font-family: comic sans ms,sans-serif;">Prise de terre<br /></span></span></td>\n<td style="text-align: left;" colspan="2"><span style="font-size: xx-small;"><span style="font-family: comic sans ms,sans-serif;">par c&acirc;ble de terre &eacute;quip&eacute; d''une cosse &agrave; oeillet (long : 0,20m, diam : 3 mm)<br /></span></span></td>\n</tr>\n<tr bgcolor="#cce3f3">\n<td style="height: 25px; text-align: left;" colspan="5"><span style="font-size: xx-small;"><span style="font-family: comic sans ms,sans-serif;">Charge maximale admissible<br /></span></span></td>\n<td style="text-align: left;" colspan="2"><span style="font-size: xx-small;"><span style="font-family: comic sans ms,sans-serif;">5400 Pa selon norme IEC 61215, test avanc&eacute;<br /></span></span></td>\n</tr>\n<tr bgcolor="#cce3f3">\n<td style="height: 25px; text-align: left;" colspan="5"><span style="font-size: xx-small;"><span style="font-family: comic sans ms,sans-serif;">R&eacute;sistance &agrave; la gr&ecirc;le<br /></span></span></td>\n<td style="text-align: left;" colspan="2"><span style="font-size: xx-small;"><span style="font-family: comic sans ms,sans-serif;">gr&ecirc;lon de 28mm de diam&egrave;tre, &agrave; une vitesse d''impact de 86 km/h<br /></span></span></td>\n</tr>\n<tr bgcolor="#cce3f3">\n<td style="height: 25px; text-align: left;" colspan="5"><span style="font-size: xx-small;"><span style="font-family: comic sans ms,sans-serif;">Poids du module<br /></span></span></td>\n<td style="text-align: left;" colspan="2"><span style="font-size: xx-small;"><span style="font-family: comic sans ms,sans-serif;">22,4 kg<br /></span></span></td>\n</tr>\n<tr bgcolor="#cce3f3">\n<td style="height: 25px; text-align: left;" colspan="5"><span style="font-size: xx-small;"><span style="font-family: comic sans ms,sans-serif;">Taille du conditionnement</span></span></td>\n<td style="text-align: left;" colspan="2"><span style="font-size: xx-small;"><span style="font-family: comic sans ms,sans-serif;">1755 x 1145 x 90 mm (1 module par carton)<br /></span></span></td>\n</tr>\n<tr bgcolor="#cce3f3">\n<td style="height: 25px; text-align: left;" colspan="5"><span style="font-size: xx-small;"><span style="font-family: comic sans ms,sans-serif;">Conditionnement<br /></span></span></td>\n<td style="text-align: left;" colspan="2"><span style="font-size: xx-small;"><span style="font-family: comic sans ms,sans-serif;">palette : 1800 x 1200 x 160 mm ; 14 modules par palette</span></span></td>\n</tr>\n<tr>\n<td style="height: 10px;" colspan="7">\n<h2 style="text-align: center;"><span style="font-size: small;"><span style="color: #3366ff;"><span style="font-family: comic sans ms,sans-serif;">Caract&eacute;ristiques &eacute;lectriques en conditions de test standard (1000 W/m&sup2;, 25&deg;C, AM 1.5)<br /></span></span></span></h2>\n</td>\n</tr>\n<tr bgcolor="#cce3f3">\n<td style="height: 40px;" colspan="5"><span style="font-family: comic sans ms,sans-serif;"></span></td>\n<td align="center"><span style="font-size: x-small;"><span style="font-family: comic sans ms,sans-serif;">SEF-250</span></span></td>\n<td>\n<p style="text-align: center;"><span style="font-family: comic sans ms,sans-serif;"><img src="http://kogys-emailing.by.catalyz.fr/uploads/repository/systovi/Module_SE_fond_blanc_400pxa.png" width="120" height="102" /></span></p>\n</td>\n</tr>\n<tr bgcolor="#cce3f3">\n<td style="height: 40px;" colspan="5"><span style="font-size: xx-small;"><span style="font-family: comic sans ms,sans-serif;">Puissance maximale<br /></span></span></td>\n<td align="center"><span style="font-size: xx-small;"><span style="font-family: comic sans ms,sans-serif;">Pmax (W)<br /></span></span></td>\n<td><span style="font-size: xx-small;"><span style="font-family: comic sans ms,sans-serif;">250<br /></span></span></td>\n</tr>\n<tr bgcolor="#cce3f3">\n<td style="height: 40px;" colspan="5"><span style="font-size: xx-small;"><span style="font-family: comic sans ms,sans-serif;">Tension au point de puissance maximale<br /></span></span></td>\n<td align="center"><span style="font-size: xx-small;"><span style="font-family: comic sans ms,sans-serif;">Vmpp (V)<br /></span></span></td>\n<td><span style="font-size: xx-small;"><span style="font-family: comic sans ms,sans-serif;">29,4</span></span></td>\n</tr>\n<tr bgcolor="#cc