(74, 'Une 7Ã¨me ATEx pour KOGYS', '', 'Une 7Ã¨me ATEx pour KOGYS', 13, '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">\r\n<html>\r\n<head>\r\n<title>Untitled document</title>\r\n</head>\r\n<body>\r\n<p></p>\r\n<p><img src="http://www.kogys.net/uploads/assets/Argence_Soleil_Aout_2011_006.jpg" height="279" width="490" /></p>\r\n<p></p>\r\n<div class="sidebar">&nbsp;</div>\r\n<h1>Une 7&egrave;me ATEx pour KOGYS !</h1>\r\n<p></p>\r\n<p><span style="font-size: small;">Conform&eacute;ment &agrave; l''objectif que nous nous &eacute;tions fix&eacute;s, nous poursuivons le travail entrepris avec le CSTB et le bureau de contr&ocirc;le APAVE pour l''am&eacute;lioration permanente du syst&egrave;me Kogysun.</span></p>\r\n<p></p>\r\n<p><span style="font-size: small;">C''est aujourd''hui plus de 250.000 m&sup2; d&eacute;j&agrave; install&eacute;s depuis le lancement de notre syst&egrave;me d''int&eacute;gration simplifi&eacute;e KOGYSUN sans aucune d&eacute;faillance d&eacute;cel&eacute;e sur les chantiers mis en oeuvre par nos installateurs agr&eacute;&eacute;s.</span></p>\r\n<p></p>\r\n<p><span style="font-size: small;">Apr&egrave;s l''obtention de notre ATEc (Avis Technique) par le CSTB en novembre 2011, notre soci&eacute;t&eacute; vient en effet d''obtenir sa 7&egrave;me ATEx (Appr&eacute;ciations Techniques Exp&eacute;rimentales) pour le chantier de la soci&eacute;t&eacute; d''Argence Soleil situ&eacute; &agrave; Sainte-Genevi&egrave;ve-sur-Argence (12).</span></p>\r\n<p></p>\r\n<p><span style="font-size: small;">&nbsp;Ce chantier a &eacute;t&eacute; r&eacute;alis&eacute; en collaboration avec plusieurs entreprises :</span></p>\r\n<p><span style="font-size: small;">- BE b&acirc;timent : Troisel</span><br /><span style="font-size: small;">- BE PV : Fauch&eacute; Lafran&ccedil;aise</span><br /><span style="font-size: small;">- BE contr&ocirc;le : Apave</span></p>\r\n<p></p>\r\n<p><span style="font-size: small;">Ce ne sont pas moins de 6363 modules (portrait) de la marque Conergy (Conergy Plus 230) qui ont &eacute;t&eacute; install&eacute;s pour une puissance total de 1 463 490 Wc pour une application agricole en version non isol&eacute;e.</span></p>\r\n<p><span style="font-size: small;">La capacit&eacute; de production est de 250 MW !</span></p>\r\n<p><span style="font-size: small;">Cet ATEx repose sur des contraintes de neige (r&eacute;gion A2), d''altitude (&gt; 800 m) et de vent (zone 2) qui sont autant d''&eacute;l&eacute;ments de nature &agrave; confirmer le bon niveau technique du syst&egrave;me KOGYSUN.</span></p>\r\n</body>\r\n</html>', '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">\r\n<html>\r\n<head>\r\n<title>Untitled document</title>\r\n</head>\r\n<body>\r\n<p></p>\r\n<p><img src="http://www.kogys.net/uploads/assets/Argence_Soleil_Aout_2011_006.jpg" height="279" width="490" /></p>\r\n<p></p>\r\n<div class="sidebar">&nbsp;</div>\r\n<h1>Une 7&egrave;me ATEx pour KOGYS !</h1>\r\n<p></p>\r\n<p><span style="font-size: small;">Conform&eacute;ment &agrave; l''objectif que nous nous &eacute;tions fix&eacute;s, nous poursuivons le travail entrepris avec le CSTB et le bureau de contr&ocirc;le APAVE pour l''am&eacute;lioration permanente du syst&egrave;me Kogysun.</span></p>\r\n<p></p>\r\n<p><span style="font-size: small;">C''est aujourd''hui plus de 250.000 m&sup2; d&eacute;j&agrave; install&eacute;s depuis le lancement de notre syst&egrave;me d''int&eacute;gration simplifi&eacute;e KOGYSUN sans aucune d&eacute;faillance d&eacute;cel&eacute;e sur les chantiers mis en oeuvre par nos installateurs agr&eacute;&eacute;s.</span></p>\r\n<p></p>\r\n<p><span style="font-size: small;">Apr&egrave;s l''obtention de notre ATEc (Avis Technique) par le CSTB en novembre 2011, notre soci&eacute;t&eacute; vient en effet d''obtenir sa 7&egrave;me ATEx (Appr&eacute;ciations Techniques Exp&eacute;rimentales) pour le chantier de la soci&eacute;t&eacute; d''Argence Soleil situ&eacute; &agrave; Sainte-Genevi&egrave;ve-sur-Argence (12).</span></p>\r\n<p></p>\r\n<p><span style="font-size: small;">&nbsp;Ce chantier a &eacute;t&eacute; r&eacute;alis&eacute; en collaboration avec plusieurs entreprises :</span></p>\r\n<p><span style="font-size: small;">- BE b&acirc;timent : Troisel</span><br /><span style="font-size: small;">- BE PV : Fauch&eacute; Lafran&ccedil;aise</span><br /><span style="font-size: small;">- BE contr&ocirc;le : Apave</span></p>\r\n<p></p>\r\n<p><span style="font-size: small;">Ce ne sont pas moins de 6363 modules (portrait) de la marque Conergy (Conergy Plus 230) qui ont &eacute;t&eacute; install&eacute;s pour une puissance total de 1 463 490 Wc pour une application agricole en version non isol&eacute;e.</span></p>\r\n<p><span style="font-size: small;">La capacit&eacute; de production est de 250 MW !</span></p>\r\n<p><span style="font-size: small;">Cet ATEx repose sur des contraintes de neige (r&eacute;gion A2), d''altitude (&gt; 800 m) et de vent (zone 2) qui sont autant d''&eacute;l&eacute;ments de nature &agrave; confirmer le bon niveau technique du syst&egrave;me KOGYSUN.</span></p>\r\n</body>\r\n</html>', '', '', 6, 'Kogys', 'postmaster@kogys.net', NULL, 1, 0, '', '', NULL, 'commercial@kogys.com', 'server1.waterproof.fr', 'postmaster@kogys.net', 'weFrera4', 1, 0, NULL, NULL, 0, NULL, NULL, NULL, '2012-06-29 17:01:09', 2, '2012-07-09 11:42:31'),
