(102, 'newsletter juillet 2012', '', 'newsletter juillet 2012', 13, '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml">\r\n<head>\r\n	<meta http-equiv="Content-Type" content="text/html; charset=utf-8" />\r\n	<title>#SUBJECT#</title>\r\n	<link rel="stylesheet" href="/Kogys/css/news.css" />\r\n</head>\r\n<body>\r\n<p><a href="#VIEW_ONLINE#">Si ce message ne s''affiche pas correctement, cliquez ici</a>.</p>\r\n<table style="width: 751px; height: 1547px;" border="0" cellpadding="0" cellspacing="0">\r\n<tbody>\r\n<tr>\r\n<td height="135" valign="top">\r\n<table style="width: 600px;" border="0" cellpadding="0" cellspacing="0">\r\n<tbody>\r\n<tr>\r\n<td valign="top" width="525"><img src="http://www.kogys.net/Kogys/images/news/logo-haut.jpg" alt="Kogys" border="0" height="93" width="254" /></td>\r\n<td valign="top" width="75"><img src="http://www.kogys.net/Kogys/images/news/logo-news.jpg" align="Newsletter" border="0" height="95" width="75" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p style="text-align: center;" class="titre-bleu"><span style="color: #3366ff;">CONCEPTEUR ET FABRICANT DU SYSTEME D''INTEGRATION SIMPLIFIEE KOGYSUN</span></p>\r\n<p style="text-align: center;" class="titre-bleu"><span style="color: #3366ff;">DISTRIBUTEUR DE MATERIEL POUR LES SYSTEMES PHOTOVOLTAIQUES</span></p>\r\n<table style="width: 600px;" border="0" cellpadding="0" cellspacing="0">\r\n<tbody>\r\n<tr>\r\n<td bgcolor="#d9e0d8" valign="top" width="210">\r\n<p><img src="http://www.kogys.net/Kogys/images/news/titre-actu.jpg" alt="Actualit&eacute;" border="0" height="94" width="256" /></p>\r\n<h2 class="titre-actu">Actualit&eacute; 1</h2>\r\n<p class="texte-actu">Une 7&egrave;me ATEX pour KOGYS</p>\r\n<h2 class="titre-actu">Actualit&eacute; 2</h2>\r\n<p class="texte-actu"><a target="_blank" href="http://www.kogys.com/fr/produits/nos-marques"><img src="http://www.kogys.net/uploads/assets/SolarMax.png" height="32" width="106" /></a></p>\r\n<p class="texte-actu">Kogys se lance dans la distribution des onduleurs solaires <a target="_blank" href="http://www.kogys.com/fr/produits/onduleurs-reseau">SOLARMAX</a></p>\r\n<h2 class="titre-actu">Nouveaux produits</h2>\r\n<p></p>\r\n<p><img src="http://www.kogys.net/uploads/assets/mastervolt_nouveau.jpg" height="29" width="112" /></p>\r\n<p></p>\r\n<p></p>\r\n<p><img src="http://www.kogys.net/uploads/assets/ES3.6TL.png" height="101" width="114" /></p>\r\n<p>Du nouveau chez Mastervolt avec une gamme qui &eacute;volue : le CS15TL et le CS20TL seront d&eacute;sormais remplac&eacute;s par le <strong><a target="_blank" href="http://www.kogys.com/fr/produits/onduleurs-reseau/sunmaster-cs15tl-rp">CS15TL RP</a><a target="_blank" href="http://www.kogys.com/fr/produits/onduleurs-reseau/sunmaster-cs20tl-rpau/sunmaster-cs15tl-rp"> et CS20TL RP</a></strong>. Ces onduleurs r&eacute;sistent encore mieux aux fluctuations de r&eacute;seau gr&acirc;ce &agrave; une meilleure tenue au creux de tension normalis&eacute;e. Ces onduleurs requi&egrave;rent un syst&egrave;me 5 conducteurs. Ceci diff&egrave;re de la version standard qui utilise une connexion triphas&eacute;e 4 conducteurs.</p>\r\n<p>Sortie &eacute;galement de la nouvelle gamme SunMaster <a target="_blank" href="http://www.kogys.com/fr/produits/onduleurs-reseau/sunmaster-es3-6tl-es4-6tl-es5-otl"><strong>ES3.6TL - ES4.6TL et ES5.OTL</strong>.</a><br />La philosophie derri&egrave;re la gamme ES est d''optimiser le rendement annuel quelles que soient les conditions, m&ecirc;me si elles sont moins favorables.</p>\r\n<p><img src="http://www.kogys.net/Kogys/images/news/titres-marques.jpg" alt="Toutes nos marques" border="0" height="112" width="210" />&nbsp;</p>\r\n<p><img src="http://www.kogys.net/uploads/assets/mastervolt_nouveau.jpg" height="29" width="112" /></p>\r\n<p></p>\r\n<p></p>\r\n<p></p>\r\n<p><img src="http://www.kogys.net/uploads/assets/SolarMax.png" height="33" width="109" /></p>\r\n<p></p>\r\n<p></p>\r\n<p></p>\r\n<p class="texte-actu"><img src="http://www.kogys.net/uploads/assets/REC_HD.png" height="30" width="82" /></p>\r\n<p></p>\r\n<p></p>\r\n</td>\r\n<td valign="top" width="20">\r\n<p></p>\r\n<p></p>\r\n<p></p>\r\n<p></p>\r\n</td>\r\n<td valign="top" width="370"><img src="http://www.kogys.net/Kogys/images/news/titre-realisation.jpg" alt="Nos r&eacute;alisations" border="0" height="94" width="453" />\r\n<h2 class="titre-contenu">Une 7&egrave;me ATEx pour KOGYS</h2>\r\n<p class="texte-contenu"><img src="http://www.kogys.net/uploads/assets/Argence_Soleil_Aout_2011_006.jpg" height="91" width="121" /></p>\r\n<p>Conform&eacute;ment &agrave; l''objectif que nous nous &eacute;tions fix&eacute;s, nous poursuivons le travail entrepris avec le CSTB et le bureau de contr&ocirc;le APAVE pour l''am&eacute;lioration permanente du syst&egrave;me Kogysun.</p>\r\n<p>C''est aujourd''hui plus de 250.000 m&sup2; d&eacute;j&agrave; install&eacute;s depuis le lancement de notre syst&egrave;me d''int&eacute;gration simplifi&eacute;e KOGYSUN sans aucune d&eacute;faillance d&eacute;cel&eacute;e sur les chantiers mis en oeuvre par nos installateurs agr&eacute;&eacute;s.</p>\r\n<p>Apr&egrave;s l''obtention de notre ATEc (Avis Technique) par le CSTB en novembre 2011, notre soci&eacute;t&eacute; vient en effet d''obtenir sa 7&egrave;me ATEx (Appr&eacute;ciations Techniques Exp&eacute;rimentales) pour le chantier de la soci&eacute;t&eacute; d''Argence Soleil situ&eacute; &agrave; Sainte-Genevi&egrave;ve-sur-Argence (12).</p>\r\n<p>&nbsp;Ce chantier a &eacute;t&eacute; r&eacute;alis&eacute; en collaboration avec plusieurs entreprises :</p>\r\n<p>- BE b&acirc;timent : Troisel<br />- BE PV : Fauch&eacute; Lafran&ccedil;aise<br />- BE contr&ocirc;le : Apave</p>\r\n<p>Ce ne sont pas moins de 6363 modules (portrait) de la marque Conergy (Conergy Plus 230) qui ont &eacute;t&eacute; install&eacute;s pour une puissance total de 1 463 490 Wc pour une application agricole en version non isol&eacute;e.</p>\r\n<p>La capacit&eacute; de production est de 250 MW !</p>\r\n<p>Cet ATEx repose sur des contraintes de neige (r&eacute;gion A2), d''altitude (&gt; 800 m) et de vent (zone 2) qui sont autant d''&eacute;l&eacute;ments de nature &agrave; confirmer le bon niveau technique du syst&egrave;me KOGYSUN.</p>\r\n<img src="http://www.kogys.net/Kogys/images/news/illustration1.jpg" alt="Images" border="0" height="76" width="119" /><img src="http://www.kogys.net/Kogys/images/news/illustration2.jpg" alt="Images" border="0" height="76" width="128" /><img src="http://www.kogys.net/Kogys/images/news/illustration3.jpg" alt="Images" border="0" height="76" width="122" /> <img src="http://www.kogys.net/Kogys/images/news/titre-photovoltaique.jpg" alt="Le monde du photovolta&Atilde;&macr;que" border="0" height="125" width="373" />\r\n<p><img src="http://www.kogys.net/uploads/assets/REC_HD.png" height="35" width="95" /></p>\r\n<p></p>\r\n<p><strong>REC</strong> (Renewable Energy Corporation), le plus grand fabricant europ&eacute;en de modules solaires, a inaugur&eacute; aujourd''hui le module REC Peak Energy Eco &ndash; un nouveau module solaire fabriqu&eacute; avec des soudures sans plomb. Un proc&eacute;d&eacute; de production innovant a permis &agrave; REC d''&eacute;liminer enti&egrave;rement le plomb habituellement utilis&eacute; durant la phase de soudure, r&eacute;duisant ainsi significativement la teneur en plomb du module. Le r&eacute;sultat est un produit encore plus &eacute;cologique, dot&eacute; d''une capacit&eacute; de production! et d''une fiabilit&eacute; aussi performantes que celles des autres modules REC. &laquo; Nous constatons qu''un nombre croissant de clients et de r&eacute;gulateurs demande des informations concernant l''empreinte &eacute;cologique des solutions solaires, &raquo; confirme Luc Grar&eacute;, vice-pr&eacute;sident directeur, Ventes et Marketing, Cellules et Modules, REC. &laquo; Le d&eacute;veloppement du module REC Peak Energy Eco souligne la volont&eacute; de REC de d&eacute;velopper des technologies ultra-performantes, associant s&eacute;curit&eacute; et durabilit&eacute; tout au long de leur cycle de vie. &raquo;&nbsp;<br /> <br /> &Agrave; l''image des autres modules de la s&eacute;rie REC Peak Energy, le module REC Peak Energy Eco fournit davantage d''&eacute;nergie par watt-cr&ecirc;te, poss&egrave;de une conception robuste et durable, est facile &amp;agrav! e; installer et est disponible imm&eacute;diatement. Les modules REC affichent &eacute;galement la plus faible empreinte carbone sur le march&eacute; des modules polycristallins, ainsi qu''un temps de retour sur investissement &eacute;nerg&eacute;tique d''un an, in&eacute;gal&eacute; dans l''industrie &ndash; notamment gr&acirc;ce au proc&eacute;d&eacute; propri&eacute;taire Fluidized Bed Reactor (FBR) de REC, qui permet de produire du silicone avec une consommation &eacute;nerg&eacute;tique inf&eacute;rieure de 90 pour cent &agrave; celle de technologies concurrentes. Toutes ces caract&eacute;ristiques aideront ce nouveau module &agrave; atteindre les objectifs environnementaux des propri&eacute;taires particuliers, des entreprises et des gouvernements d&eacute;sireux de r&eacute;duire leur empreuntes carbones et de r&eacute;aliser des &eacute;conomies sur le co&ucirc;t de l''&eacute;nergie.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style="width: 600px;" border="0" cellpadding="0" cellspacing="0">\r\n<tbody>\r\n<tr>\r\n<td height="130" width="280"><img src="http://www.kogys.net/Kogys/images/news/logo-haut.jpg" alt="Kogys" border="0" height="93" width="254" /></td>\r\n<td>\r\n<p class="bleu">382 Impasse des Tamaris<br /> ZA du Fray&eacute;<br /> 82000 MONTAUBAN</p>\r\n</td>\r\n<td>\r\n<p class="bleu">T&eacute;l : 05 63 91 20 14<br /> Fax : 05 63 91 20 15<br /> <b><a href="mailto:contact@kogys.com" class="liens-vert">contact@kogys.com</a></b></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style="width: 600px;" bgcolor="#969192" border="0" cellpadding="0" cellspacing="0">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p class="texte-blanc">Conform&eacute;ment &agrave; la loi Informatique et Libert&eacute;s du 06/01/1978, vous disposez d''un droit d''acc&egrave;s, de rectification et d''opposition aux informations vous concernant qui peut s''exercer par e-mail &agrave; <a href="mailto:contact@kogys.com">contact@kogys.com</a> ou par courrier en indiquant votre nom et pr&eacute;nom. Si vous ne souhaitez plus recevoir notre newsletter, il vous suffit <a href="#UNSUBSCRIBE#">cliquer ici</a></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</body>\r\n</html>', '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml">\r\n<head>\r\n	<meta http-equiv="Content-Type" content="text/html; charset=utf-8" />\r\n	<title>#SUBJECT#</title>\r\n	<style class="text/css">\nBODY , HTML , TABLE {\r\n	font-family:Verdana, Arial, Helvetica, sans-serif;\r\n	font-size:12px;\r\n	color:#515151;\r\n}\r\nP , A , LI , UL , H1 , H2 , H3 {\r\n	margin:0;\r\n	padding:0;\r\n}\r\n\r\n.titre-bleu {\r\n	color:#13335f;\r\n	font-weight:bold;\r\n	text-transform:uppercase;\r\n	margin:0 0 20px 0;\r\n}\r\n.titre-actu {\r\n	color:#13335f;\r\n	font-size:14px;\r\n	font-weight:bold;\r\n	border-bottom:1px dashed #13335f;\r\n	padding:5px;\r\n	margin:10px 10px 0px 10px;\r\n}\r\n.texte-actu {\r\n	padding:5px;\r\n	margin:0px 10px 5px 10px;\r\n	line-height:18px;\r\n}\r\n.titre-contenu {\r\n	color:#13335f;\r\n	font-size:14px;\r\n	font-weight:bold;\r\n	margin:15px 0px 0px 0px;\r\n}\r\n.texte-contenu {\r\n	margin:10px 0px 0px 0px;\r\n	line-height:18px;\r\n}\r\nA.liens-vert {\r\n	font-weight:bold;\r\n	color:#a6c63d;\r\n	text-decoration:none;\r\n	line-height:18px;\r\n}\r\nA.liens-vert:HOVER {\r\n	text-decoration:underline;\r\n}\r\n.bleu {\r\n	font-size:11px;\r\n	color:#13335f;\r\n}\r\n.texte-blanc {\r\n	font-size:9px;\r\n	color:#FFFFFF;\r\n	text-align:center;\r\n	padding:10px;\r\n}\r\n.texte-blanc A {\r\n	font-size:9px;\r\n	color:#FFFFFF;\r\n	font-weight:bold;\r\n	text-decoration:none;\r\n}\r\nimg {\r\n	margin: 0px;\r\n	padding: 0px;\r\n}</style>\r\n</head>\r\n<body>\r\n<p><a href="#VIEW_ONLINE#">Si ce message ne s''affiche pas correctement, cliquez ici</a>.</p>\r\n<table style="width: 751px; height: 1547px;" border="0" cellpadding="0" cellspacing="0">\r\n<tbody>\r\n<tr>\r\n<td height="135" valign="top">\r\n<table style="width: 600px;" border="0" cellpadding="0" cellspacing="0">\r\n<tbody>\r\n<tr>\r\n<td valign="top" width="525"><img src="http://www.kogys.net/Kogys/images/news/logo-haut.jpg" alt="Kogys" border="0" height="93" width="254" /></td>\r\n<td valign="top" width="75"><img src="http://www.kogys.net/Kogys/images/news/logo-news.jpg" align="Newsletter" border="0" height="95" width="75" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p style="text-align: center;" class="titre-bleu"><span style="color: #3366ff;">CONCEPTEUR ET FABRICANT DU SYSTEME D''INTEGRATION SIMPLIFIEE KOGYSUN</span></p>\r\n<p style="text-align: center;" class="titre-bleu"><span style="color: #3366ff;">DISTRIBUTEUR DE MATERIEL POUR LES SYSTEMES PHOTOVOLTAIQUES</span></p>\r\n<table style="width: 600px;" border="0" cellpadding="0" cellspacing="0">\r\n<tbody>\r\n<tr>\r\n<td bgcolor="#d9e0d8" valign="top" width="210">\r\n<p><img src="http://www.kogys.net/Kogys/images/news/titre-actu.jpg" alt="Actualit&eacute;" border="0" height="94" width="256" /></p>\r\n<h2 class="titre-actu">Actualit&eacute; 1</h2>\r\n<p class="texte-actu">Une 7&egrave;me ATEX pour KOGYS</p>\r\n<h2 class="titre-actu">Actualit&eacute; 2</h2>\r\n<p class="texte-actu"><a target="_blank" href="http://www.kogys.net/campaign/link/key/#EMAIL#-111-1"><img src="http://www.kogys.net/uploads/assets/SolarMax.png" height="32" width="106" /></a></p>\r\n<p class="texte-actu">Kogys se lance dans la distribution des onduleurs solaires <a target="_blank" href="http://www.kogys.net/campaign/link/key/#EMAIL#-113-1">SOLARMAX</a></p>\r\n<h2 class="titre-actu">Nouveaux produits</h2>\r\n<p></p>\r\n<p><img src="http://www.kogys.net/uploads/assets/mastervolt_nouveau.jpg" height="29" width="112" /></p>\r\n<p></p>\r\n<p></p>\r\n<p><img src="http://www.kogys.net/uploads/assets/ES3.6TL.png" height="101" width="114" /></p>\r\n<p>Du nouveau chez Mastervolt avec une gamme qui &eacute;volue : le CS15TL et le CS20TL seront d&eacute;sormais remplac&eacute;s par le <strong><a target="_blank" href="http://www.kogys.net/campaign/link/key/#EMAIL#-101-1">CS15TL RP</a><a target="_blank" href="http://www.kogys.net/campaign/link/key/#EMAIL#-103-1"> et CS20TL RP</a></strong>. Ces onduleurs r&eacute;sistent encore mieux aux fluctuations de r&eacute;seau gr&acirc;ce &agrave; une meilleure tenue au creux de tension normalis&eacute;e. Ces onduleurs requi&egrave;rent un syst&egrave;me 5 conducteurs. Ceci diff&egrave;re de la version standard qui utilise une connexion triphas&eacute;e 4 conducteurs.</p>\r\n<p>Sortie &eacute;galement de la nouvelle gamme SunMaster <a target="_blank" href="http://www.kogys.net/campaign/link/key/#EMAIL#-102-1"><strong>ES3.6TL - ES4.6TL et ES5.OTL</strong>.</a><br />La philosophie derri&egrave;re la gamme ES est d''optimiser le rendement annuel quelles que soient les conditions, m&ecirc;me si elles sont moins favorables.</p>\r\n<p><img src="http://www.kogys.net/Kogys/images/news/titres-marques.jpg" alt="Toutes nos marques" border="0" height="112" width="210" />&nbsp;</p>\r\n<p><img src="http://www.kogys.net/uploads/assets/mastervolt_nouveau.jpg" height="29" width="112" /></p>\r\n<p></p>\r\n<p></p>\r\n<p></p>\r\n<p><img src="http://www.kogys.net/uploads/assets/SolarMax.png" height="33" width="109" /></p>\r\n<p></p>\r\n<p></p>\r\n<p></p>\r\n<p class="texte-actu"><img src="http://www.kogys.net/uploads/assets/REC_HD.png" height="30" width="82" /></p>\r\n<p></p>\r\n<p></p>\r\n</td>\r\n<td valign="top" width="20">\r\n<p></p>\r\n<p></p>\r\n<p></p>\r\n<p></p>\r\n</td>\r\n<td valign="top" width="370"><img src="http://www.kogys.net/Kogys/images/news/titre-realisation.jpg" alt="Nos r&eacute;alisations" border="0" height="94" width="453" />\r\n<h2 class="titre-contenu">Une 7&egrave;me ATEx pour KOGYS</h2>\r\n<p class="texte-contenu"><img src="http://www.kogys.net/uploads/assets/Argence_Soleil_Aout_2011_006.jpg" height="91" width="121" /></p>\r\n<p>Conform&eacute;ment &agrave; l''objectif que nous nous &eacute;tions fix&eacute;s, nous poursuivons le travail entrepris avec le CSTB et le bureau de contr&ocirc;le APAVE pour l''am&eacute;lioration permanente du syst&egrave;me Kogysun.</p>\r\n<p>C''est aujourd''hui plus de 250.000 m&sup2; d&eacute;j&agrave; install&eacute;s depuis le lancement de notre syst&egrave;me d''int&eacute;gration simplifi&eacute;e KOGYSUN sans aucune d&eacute;faillance d&eacute;cel&eacute;e sur les chantiers mis en oeuvre par nos installateurs agr&eacute;&eacute;s.</p>\r\n<p>Apr&egrave;s l''obtention de notre ATEc (Avis Technique) par le CSTB en novembre 2011, notre soci&eacute;t&eacute; vient en effet d''obtenir sa 7&egrave;me ATEx (Appr&eacute;ciations Techniques Exp&eacute;rimentales) pour le chantier de la soci&eacute;t&eacute; d''Argence Soleil situ&eacute; &agrave; Sainte-Genevi&egrave;ve-sur-Argence (12).</p>\r\n<p>&nbsp;Ce chantier a &eacute;t&eacute; r&eacute;alis&eacute; en collaboration avec plusieurs entreprises :</p>\r\n<p>- BE b&acirc;timent : Troisel<br />- BE PV : Fauch&eacute; Lafran&ccedil;aise<br />- BE contr&ocirc;le : Apave</p>\r\n<p>Ce ne sont pas moins de 6363 modules (portrait) de la marque Conergy (Conergy Plus 230) qui ont &eacute;t&eacute; install&eacute;s pour une puissance total de 1 463 490 Wc pour une application agricole en version non isol&eacute;e.</p>\r\n<p>La capacit&eacute; de production est de 250 MW !</p>\r\n<p>Cet ATEx repose sur des contraintes de neige (r&eacute;gion A2), d''altitude (&gt; 800 m) et de vent (zone 2) qui sont autant d''&eacute;l&eacute;ments de nature &agrave; confirmer le bon niveau technique du syst&egrave;me KOGYSUN.</p>\r\n<img src="http://www.kogys.net/Kogys/images/news/illustration1.jpg" alt="Images" border="0" height="76" width="119" /><img src="http://www.kogys.net/Kogys/images/news/illustration2.jpg" alt="Images" border="0" height="76" width="128" /><img src="http://www.kogys.net/Kogys/images/news/illustration3.jpg" alt="Images" border="0" height="76" width="122" /> <img src="http://www.kogys.net/Kogys/images/news/titre-photovoltaique.jpg" alt="Le monde du photovolta&Atilde;&macr;que" border="0" height="125" width="373" />\r\n<p><img src="http://www.kogys.net/uploads/assets/REC_HD.png" height="35" width="95" /></p>\r\n<p></p>\r\n<p><strong>REC</strong> (Renewable Energy Corporation), le plus grand fabricant europ&eacute;en de modules solaires, a inaugur&eacute; aujourd''hui le module REC Peak Energy Eco &ndash; un nouveau module solaire fabriqu&eacute; avec des soudures sans plomb. Un proc&eacute;d&eacute; de production innovant a permis &agrave; REC d''&eacute;liminer enti&egrave;rement le plomb habituellement utilis&eacute; durant la phase de soudure, r&eacute;duisant ainsi significativement la teneur en plomb du module. Le r&eacute;sultat est un produit encore plus &eacute;cologique, dot&eacute; d''une capacit&eacute; de production! et d''une fiabilit&eacute; aussi performantes que celles des autres modules REC. &laquo; Nous constatons qu''un nombre croissant de clients et de r&eacute;gulateurs demande des informations concernant l''empreinte &eacute;cologique des solutions solaires, &raquo; confirme Luc Grar&eacute;, vice-pr&eacute;sident directeur, Ventes et Marketing, Cellules et Modules, REC. &laquo; Le d&eacute;veloppement du module REC Peak Energy Eco souligne la volont&eacute; de REC de d&eacute;velopper des technologies ultra-performantes, associant s&eacute;curit&eacute; et durabilit&eacute; tout au long de leur cycle de vie. &raquo;&nbsp;<br /> <br /> &Agrave; l''image des autres modules de la s&eacute;rie REC Peak Energy, le module REC Peak Energy Eco fournit davantage d''&eacute;nergie par watt-cr&ecirc;te, poss&egrave;de une conception robuste et durable, est facile &amp;agrav! e; installer et est disponible imm&eacute;diatement. Les modules REC affichent &eacute;galement la plus faible empreinte carbone sur le march&eacute; des modules polycristallins, ainsi qu''un temps de retour sur investissement &eacute;nerg&eacute;tique d''un an, in&eacute;gal&eacute; dans l''industrie &ndash; notamment gr&acirc;ce au proc&eacute;d&eacute; propri&eacute;taire Fluidized Bed Reactor (FBR) de REC, qui permet de produire du silicone avec une consommation &eacute;nerg&eacute;tique inf&eacute;rieure de 90 pour cent &agrave; celle de technologies concurrentes. Toutes ces caract&eacute;ristiques aideront ce nouveau module &agrave; atteindre les objectifs environnementaux des propri&eacute;taires particuliers, des entreprises et des gouvernements d&eacute;sireux de r&eacute;duire leur empreuntes carbones et de r&eacute;aliser des &eacute;conomies sur le co&ucirc;t de l''&eacute;nergie.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style="width: 600px;" border="0" cellpadding="0" cellspacing="0">\r\n<tbody>\r\n<tr>\r\n<td height="130" width="280"><img src="http://www.kogys.net/Kogys/images/news/logo-haut.jpg" alt="Kogys" border="0" height="93" width="254" /></td>\r\n<td>\r\n<p class="bleu">382 Impasse des Tamaris<br /> ZA du Fray&eacute;<br /> 82000 MONTAUBAN</p>\r\n</td>\r\n<td>\r\n<p class="bleu">T&eacute;l : 05 63 91 20 14<br /> Fax : 05 63 91 20 15<br /> <b><a href="mailto:contact@kogys.com" class="liens-vert">contact@kogys.com</a></b></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style="width: 600px;" bgcolor="#969192" border="0" cellpadding="0" cellspacing="0">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p class="texte-blanc">Conform&eacute;ment &agrave; la loi Informatique et Libert&eacute;s du 06/01/1978, vous disposez d''un droit d''acc&egrave;s, de rectification et d''opposition aux informations vous concernant qui peut s''exercer par e-mail &agrave; <a href="mailto:contact@kogys.com">contact@kogys.com</a> ou par courrier en indiquant votre nom et pr&eacute;nom. Si vous ne souhaitez plus recevoir notre newsletter, il vous suffit <a href="#UNSUBSCRIBE#">cliquer ici</a></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</body>\r\n</html>', '', '', 6, 'Kogys', 'postmaster@kogys.net', NULL, 1, 0, '', '', 'contact@kogys.com', 'commercial@kogys.com', 'server1.waterproof.fr', 'postmaster@kogys.net', 'weFrera4', 1, 0, NULL, NULL, 0, NULL, NULL, NULL, '2012-07-09 10:10:53', 2, '2012-08-28 16:27:22');
