						<img style="display: block;" src="http://www.kogys.net/Kogys/images/news/left_sep.gif" height="16" alt="" border="0" width="180" />\r\n						<br/>\r\n						<font face="Verdana, Geneva, sans-serif" style="line-height: 18px; font-size: 10px;" size="2" color="#000000">Accedat huc suavitas quaedam oportet sermonum atque mor, haudquaquam mediocre condimentum amicitiae.\r\n						</font>\r\n					</td>\r\n					<td width="15"><img style="display: block;" src="http://www.kogys.net/Kogys/images/news/spacer_blue.gif" height="1" alt="" border="0" width="15" /></td>\r\n				</tr>\r\n				<tr>\r\n					<td colspan="3"><img style="display: block;" src="http://www.kogys.net/Kogys/images/news/spacer_blue.gif" alt="" height="10" border="0" width="210" /></td>\r\n				</tr>\r\n				<tr>\r\n					<td width="15"><img style="display: block;" src="http://www.kogys.net/Kogys/images/news/spacer_blue.gif" height="1" alt="" border="0" width="15" /></td>\r\n					<td width="180">\r\n						<font face="Verdana, Geneva, sans-serif" style="line-height: 18px; font-size: 14px; font-weight: bold;" size="2" color="#13335F">Nouveaux produits\r\n						</font>\r\n						<img style="display: block;" src="http://www.kogys.net/Kogys/images/news/left_sep.gif" height="16" alt="" border="0" width="180" />\r\n						<br/>\r\n						<img style="display: block;" src="http://www.kogys.net/Kogys/images/news/produit.jpg" alt="Nouveaux produit" height="80" border="0" width="127" />\r\n						<br/>\r\n						<font face="Verdana, Geneva, sans-serif" style="line-height: 18px; font-size: 10px;" size="2" color="#000000">Accedat huc suavitas quaedam oportet sermonum atque mor, haudquaquam mediocre condimentum amicitiae.\r\n						</font>\r\n					</td>\r\n					<td width="15"><img style="display: block;" src="http://www.kogys.net/Kogys/images/news/spacer_blue.gif" height="1" alt="" border="0" width="15" /></td>\r\n				</tr>\r\n\r\n				<tr>\r\n					<td colspan="3"><img src="http://www.kogys.net/Kogys/images/news/titres-marques.jpg" a